// App.js
import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom'; // Importime BrowserRouter, Routes ja Route
import HomeScreen from './screens/HomeScreen'; // Impordime HomeScreen komponendi

const App = () => {
  return (
    <Router>
      <Routes>
        <Route exact path="/" element={<HomeScreen />} /> {/* Marsruut avalehele, kus kasutame HomeScreen komponenti */}
      </Routes>
    </Router>
  );
}

export default App;
